function App() {
  const name = "sumit";
  return (
    <>
      <h1>My Netflix Pick {name}</h1>
      <p>List of 5 Series</p>
      <ol>
        <li>Dark</li>
        <li>Extra Curricular</li>
        <li>My Holo love</li>
        <li>Computer Science</li>
        <li>Mr Robot</li>
      </ol>
    </>
  );
}

export default App;
